// src/components/AboutUs.jsx
import React from 'react';
import './About.css';

function About() {
  return (
    <div className="about-section">
      <h2>
        ABOUT ME
        <span>ABOUT ME</span>
        <span>ABOUT ME</span>
        <span>Joy Chowdhury</span>
      </h2>
    </div>
  );
}

export default About;
